Interface to instruct the MCU to enter a low power state. TEP112
describes how an MCU computes this state and how the Scheduler uses
this interface to manage system power draw.

@author Philip Levis
@author Martin Turon <mturon@xbow.com>
@date   Oct 26, 2005

Interface to allow high-level components to set a lower bound for a
microcontroller's low power state. This is sometimes necessary,
e.g., if a very low power state has a long wakeup latency that will
violate application timing requirements. TEP 112 describes how
TinyOS incorporates this information when the Scheduler tells
the MCU to enter a low power state.

@author Philip Levis
@date   Oct 26, 2005
@see    TEP 112: Microconroller Power Management

Constants for manipulating LEDs.

@author Philip Levis
@date   March 21, 2005

Interface to instruct TinyOS that the low-power state of the MCU
may have changed. TEP 112 describes how an MCU computes this state
and how the Scheduler uses this interface to manage system power
draw.

@author Philip Levis
@date   Oct 26, 2005
@see    TEP 112: Microcontroller Power Management

Return the delay or period for the previously started timer. The next
fired event will occur at gett0() + getdt().
@return Timer's interval.

Check if timer is running. Periodic timers run until stopped or
replaced, one-shot timers run until their deadline expires.

@return TRUE if the timer is still running.

Send a single uart byte. The call blocks until it is ready to
accept another byte for sending.

@param byte The byte to send.
@return SUCCESS if byte was sent, FAIL otherwise.

Receive a single uart byte. The call blocks until a byte is
received.

@param 'uint8_t* ONE byte' Where to place received byte.
@param timeout How long in byte times to wait.
@return SUCCESS if a byte was received, FAIL if timed out.

